import{_ as t}from"./chunks/cubepilot_cube_orangeplus_standard_set.DzZdU1T8.js";import{_ as e,a as r}from"./chunks/cube_ports_usb_sdcard.DjqeRsN_.js";import{_ as a,c as d,o as i,ab as o}from"./chunks/framework.CUflZczI.js";const S=JSON.parse('{"title":"CubePilot Cube Orange+ Flight Controller","description":"","frontmatter":{},"headers":[],"relativePath":"zh/flight_controller/cubepilot_cube_orangeplus.md","filePath":"zh/flight_controller/cubepilot_cube_orangeplus.md"}'),l={name:"zh/flight_controller/cubepilot_cube_orangeplus.md"},n=o('<h1 id="cubepilot-cube-orange-flight-controller" tabindex="-1">CubePilot Cube Orange+ Flight Controller <a class="header-anchor" href="#cubepilot-cube-orange-flight-controller" aria-label="Permalink to &quot;CubePilot Cube Orange+ Flight Controller&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://cubepilot.org/#/home" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <a href="https://www.cubepilot.com/#/cube/features" target="_blank" rel="noreferrer">Cube Orange+</a> flight controller is a flexible autopilot intended primarily for manufacturers of commercial systems. Cube Orange+ is similar to Cube Orange, but has a more powerful dual-core processor (STM32H757, and some different sensors parts.</p><p><img src="'+t+'" alt="Cube Orange"></p><p>The controller is designed to be used with a domain-specific carrier board in order to reduce the wiring, improve reliability, and ease of assembly. For example, a carrier board for a commercial inspection vehicle might include connections for a companion computer, while a carrier board for a racer could includes ESCs for the frame of the vehicle.</p><p>The ADS-B carrier board includes a customized 1090MHz ADSB-In receiver from uAvionix. This provides attitude and location of commercial manned aircraft within the range of Cube. This is automatically configured and enabled in the default PX4 firmware.</p><p>Cube includes vibration isolation on two of the IMU&#39;s, with a third fixed IMU as a reference / backup.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The manufacturer <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Cube Docs</a> contain detailed information, including an overview of the <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview#differences-between-cube-colours" target="_blank" rel="noreferrer">Differences between Cube Colours</a>.</p></div><h2 id="key-features" tabindex="-1">Key Features <a class="header-anchor" href="#key-features" aria-label="Permalink to &quot;Key Features&quot;">​</a></h2><ul><li>32bit STM32H757ZI (32bit <a href="https://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M7" target="_blank" rel="noreferrer">ARM Cortex M7</a>, 400 MHz, Flash 2MB, RAM 1MB).</li><li>32 bit STM32F103 failsafe co-processor</li><li>14 PWM / Servo outputs (8 with failsafe and manual override, 6 auxiliary, high-power compatible)</li><li>Abundant connectivity options for additional peripherals (UART, I2C, CAN)</li><li>Integrated backup system for in-flight recovery and manual override with dedicated processor and stand-alone power supply (fixed-wing use)</li><li>Backup system integrates mixing, providing consistent autopilot and manual override mixing modes (fixed-wing use)</li><li>Redundant power supply inputs and automatic failover</li><li>External safety switch</li><li>Multicolor LED main visual indicator</li><li>High-power, multi-tone piezo audio indicator</li><li>microSD card for high-rate logging over extended periods of time</li></ul><p><a id="stores"></a></p><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="https://www.cubepilot.com/#/reseller/list" target="_blank" rel="noreferrer">Reseller list</a></li></ul><h2 id="assembly" tabindex="-1">Assembly <a class="header-anchor" href="#assembly" aria-label="Permalink to &quot;Assembly&quot;">​</a></h2><p><a href="./../assembly/quick_start_cube.html">Cube Wiring Quickstart</a></p><h2 id="specifications" tabindex="-1">Specifications <a class="header-anchor" href="#specifications" aria-label="Permalink to &quot;Specifications&quot;">​</a></h2><ul><li><strong>Processor:</strong><ul><li>STM32H757 (32bit <a href="https://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M7" target="_blank" rel="noreferrer">ARM Cortex M7</a>)</li><li>400 MHz</li><li>1 MB RAM</li><li>2 MB Flash (fully accessible)</li></ul></li><li><strong>Failsafe co-processor:</strong><ul><li>STM32F103 (32bit <em>ARM Cortex-M3</em>)</li><li>24 MHz</li><li>8 KB SRAM</li></ul></li><li><strong>Sensors:</strong> (all connected via SPI) <ul><li><strong>Accelerometer:</strong> (3) ICM42688p, ICM20948, ICM20649</li><li><strong>Gyroscope:</strong> (3) ICM42688p, ICM20948, ICM20649</li><li><strong>Compass:</strong> (1) ICM20948</li><li><strong>Barometric Pressure Sensor:</strong> (2) MS5611</li></ul></li><li><strong>Operating Conditions:</strong><ul><li><strong>Operating Temp:</strong> -10C to 55C</li><li><strong>IP rating/Waterproofing:</strong> Not waterproof</li><li><strong>Servo rail input voltage:</strong> 3.3V / 5V</li><li><strong>USB port input:</strong><ul><li>Voltage: 4V - 5.7V</li><li>Rated current: 250 mA</li></ul></li><li><strong>POWER:</strong><ul><li>Input voltage: 4.1V - 5.7V</li><li>Rated input current: 2.5A</li><li>Rated input/output power: 14W</li></ul></li></ul></li><li><strong>Dimensions:</strong><ul><li><strong>Cube:</strong> 38.25mm x 38.25mm x 22.3mm</li><li><strong>Carrier:</strong> 94.5mm x 44.3mm x 17.3mm</li></ul></li><li><strong>Interfaces</strong><ul><li>IO Ports: 14 PWM servo outputs (8 from IO, 6 from FMU)</li><li>5x UART (serial ports), one high-power capable, 2x with HW flow control</li><li>2x CAN (one with internal 3.3V transceiver, one on expansion connector)</li><li><strong>R/C inputs:</strong><ul><li>Spektrum DSM / DSM2 / DSM-X® Satellite compatible input</li><li>Futaba S.BUS® compatible input and output</li><li>PPM-SUM signal input</li></ul></li><li>RSSI (PWM or voltage) input</li><li>I2C</li><li>SPI</li><li>3.3v ADC input</li><li>Internal microUSB port and external microUSB port extension</li></ul></li></ul><h2 id="ports" tabindex="-1">Ports <a class="header-anchor" href="#ports" aria-label="Permalink to &quot;Ports&quot;">​</a></h2><h3 id="top-side-gps-telem-etc" tabindex="-1">Top-Side (GPS, TELEM etc) <a class="header-anchor" href="#top-side-gps-telem-etc" aria-label="Permalink to &quot;Top-Side (GPS, TELEM etc)&quot;">​</a></h3><p><img src="'+e+'" alt="Cube Ports - Top (GPS, TELEM etc) and Main/AUX"></p><h2 id="pinouts" tabindex="-1">Pinouts <a class="header-anchor" href="#pinouts" aria-label="Permalink to &quot;Pinouts&quot;">​</a></h2><h4 id="telem1-telem2-ports" tabindex="-1">TELEM1, TELEM2 ports <a class="header-anchor" href="#telem1-telem2-ports" aria-label="Permalink to &quot;TELEM1, TELEM2 ports&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>CTS (IN)</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>RTS (OUT)</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="gps1-port" tabindex="-1">GPS1 port <a class="header-anchor" href="#gps1-port" aria-label="Permalink to &quot;GPS1 port&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>SCL I2C2</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>SDA I2C2</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>Safety Button</td><td>GND</td></tr><tr><td>7 (blk)</td><td>Button LED</td><td>GND</td></tr><tr><td>8 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="gps2-port" tabindex="-1">GPS2 port <a class="header-anchor" href="#gps2-port" aria-label="Permalink to &quot;GPS2 port&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>SCL I2C1</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>SDA I2C1</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="adc" tabindex="-1">ADC <a class="header-anchor" href="#adc" aria-label="Permalink to &quot;ADC&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>ADC IN</td><td>up to +6.6V</td></tr><tr><td>3 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="i2c" tabindex="-1">I2C <a class="header-anchor" href="#i2c" aria-label="Permalink to &quot;I2C&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>SCL</td><td>+3.3 (pullups)</td></tr><tr><td>3 (blk)</td><td>SDA</td><td>+3.3 (pullups)</td></tr><tr><td>4 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="can1-can2" tabindex="-1">CAN1 &amp; CAN2 <a class="header-anchor" href="#can1-can2" aria-label="Permalink to &quot;CAN1 &amp; CAN2&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>CAN_H</td><td>+12V</td></tr><tr><td>3 (blk)</td><td>CAN_L</td><td>+12V</td></tr><tr><td>4 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="power1-power2" tabindex="-1">POWER1 &amp; POWER2 <a class="header-anchor" href="#power1-power2" aria-label="Permalink to &quot;POWER1 &amp; POWER2&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>3 (blk)</td><td>CURRENT sensing</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>VOLTAGE sensing</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>GND</td><td>GND</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="usb" tabindex="-1">USB <a class="header-anchor" href="#usb" aria-label="Permalink to &quot;USB&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>OTG_DP1</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>OTG_DM1</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>GND</td><td>GND</td></tr><tr><td>5 (blk)</td><td>BUZZER</td><td>Battery voltage</td></tr><tr><td>6 (blk)</td><td>FMU Error LED</td><td></td></tr></tbody></table><h4 id="spkt" tabindex="-1">SPKT <a class="header-anchor" href="#spkt" aria-label="Permalink to &quot;SPKT&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (blk)</td><td>IN</td><td></td></tr><tr><td>2 (blk)</td><td>GND</td><td>GND</td></tr><tr><td>3 (red)</td><td>OUT</td><td>+3.3V</td></tr></tbody></table><h4 id="telem1-telem2" tabindex="-1">TELEM1, TELEM2 <a class="header-anchor" href="#telem1-telem2" aria-label="Permalink to &quot;TELEM1, TELEM2&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>TX (OUT)</td><td>+3.3V to 5V</td></tr><tr><td>3 (blk)</td><td>RX (IN)</td><td>+3.3V to 5V</td></tr><tr><td>4 (blk)</td><td>CTS (OUT)</td><td>+3.3V to 5V</td></tr><tr><td>5 (blk)</td><td>RTS (IN)</td><td>+3.3V to 5V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>USART2</td><td>/dev/ttyS0</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS1</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td>/dev/ttyS2</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS3</td><td>PX4IO</td></tr><tr><td>UART7</td><td>/dev/ttyS4</td><td>CONSOLE/ADSB-IN</td></tr><tr><td>UART8</td><td>/dev/ttyS5</td><td>GPS2</td></tr></tbody></table><h3 id="usb-sdcard-ports" tabindex="-1">USB/SDCard Ports <a class="header-anchor" href="#usb-sdcard-ports" aria-label="Permalink to &quot;USB/SDCard Ports&quot;">​</a></h3><p><img src="'+r+'" alt="Cube USB/SDCard Ports"></p><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The firmware for Orange+ will be present in releases from PX4 v1.14.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target, open up the terminal and enter:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make cubepilot_cubeorangeplus</span></span></code></pre></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The firmware for Cube Orange+ and Cube Orange are not compatible. Due to a power feature of the STM32H757 it required <a href="https://github.com/PX4/NuttX/pull/214" target="_blank" rel="noreferrer">updates in NuttX</a> and therefore a new board config, bootloader, build target, etc.</p></div><h2 id="schematics" tabindex="-1">Schematics <a class="header-anchor" href="#schematics" aria-label="Permalink to &quot;Schematics&quot;">​</a></h2><p>Board schematics and other documentation can be found here: <a href="https://github.com/proficnc/The-Cube" target="_blank" rel="noreferrer">The Cube Project</a>.</p><h2 id="further-information-documentation" tabindex="-1">Further Information/Documentation <a class="header-anchor" href="#further-information-documentation" aria-label="Permalink to &quot;Further Information/Documentation&quot;">​</a></h2><ul><li><a href="./../assembly/quick_start_cube.html">Cube Wiring Quickstart</a></li><li>Cube Docs (Manufacturer): <ul><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Cube Module Overview</a></li><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-user-manual" target="_blank" rel="noreferrer">Cube User Manual</a></li><li><a href="https://docs.cubepilot.org/user-guides/carrier-boards/mini-carrier-board" target="_blank" rel="noreferrer">Mini Carrier Board</a></li></ul></li></ul>',54),s=[n];function h(u,c,b,p,m,g){return i(),d("div",null,s)}const P=a(l,[["render",h]]);export{S as __pageData,P as default};
